var mainCtrl = angular.module('mainCtrl');

mainCtrl.controller('nzbgetCtrl', [
    '$scope',
    'loggerService',
    'nzbgetService',
    function ($scope, loggerService, nzbgetService) {

      $scope.datas = [];
      $scope.isFullyLoaded = false;

      $scope.getServerConfig = function () {
        $scope.datas = [];
        $scope.isFullyLoaded = false;
        nzbgetService.getServerConfig().then(function (config) {

          loggerService.turnOn();

          $scope.datas = config.result;
          angular.forEach($scope.datas, function (data) {
            loggerService.log(data.Name + ' => ' + data.Value);
          });

          $scope.isFullyLoaded = true;
        });
      };

      $scope.sendNzbFile = function () {
        loggerService.turnOn();
        $scope.isFullyLoaded = false;
        var nzbFileContentAsBase64 = "";
        nzbgetService.sendNzbFile('YWRtaW46UjY/blVpOW4=',"test.nzb", 'nzbget', nzbFileContentAsBase64).then(function (resp) {
          //todo manager the resp.result error cases <= 0
          var result = resp.result;
          if(result <= 0){
            loggerService.log('Error while trying to upload the nzb to Nzbget  : ' + result, 'e');
          } else {
            loggerService.log('The nzb file was successfuly uploaded to Nzbget');
          }
        });
      };

    }]
);
